import crosshair1 from "./crosshair1.png";
import crosshair2 from "./crosshair2.png";
import crosshair3 from "./crosshair3.png";
import crosshair4 from "./crosshair4.png";

const crosshair = {
  crosshair1: crosshair1,
  crosshair2: crosshair2,
  crosshair3: crosshair3,
  crosshair4: crosshair4,
};

export default crosshair;
